import React, { useEffect, useState } from "react";
import { fetchCountryCodes } from "../API/apiServices";

const CountryCodes = () => {
    const [countries, setCountries] = useState([]);

    useEffect(() => {
        const getCountries = async () => {
        fetchCountryCodes().then((resp)=>{
setCountries(resp)
        }).catch(()=>{

        })

        };

        getCountries();
    }, []);

    return (
        <div className="p-4">
            <h2 className="text-xl font-bold mb-4">Country Codes</h2>
            <table className="min-w-full bg-white border border-gray-300">
                <thead>
                    <tr className="bg-gray-200">
                        <th className="border px-4 py-2">Country Name</th>
                        <th className="border px-4 py-2">Country Code</th>
                    </tr>
                </thead>
                <tbody>
                    {countries.map((country, index) => (
                        <tr key={index} className="border">
                            <td className="border px-4 py-2">{country.CountryName}</td>
                            <td className="border px-4 py-2">{country.CountryCode}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default CountryCodes;
